        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](29, "Listening to music for pleasure is like opening a cascade of emotions that feel so new and yet so familiar at the same time. Everyone has a music taste, and many existing factors can develop or change an individual\u2019s taste in music. There are millions of songs for anything imaginable, such as heartbreak, depression, joy, love, and many others. Music is a beautiful thing and listening to music from different periods gives a taste of what it was like for the people living in those days. Nowadays, music is more based on emotional relatability, one person\u2019s message of their hardships could become another\u2019s support during challenging times. The music of Generation Z is worth a listen by the others outside of it.");
