        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](31, "Generation Z\u2019s music focuses on relatability and emotions that the listener can understand and apply to themselves. \u201CSay Something\u201D written by Christina Aguilera, does not tell a specific story of a person or event, but its lyrics are much broader, therefore being more relatable to a diverse audience. The chorus of this song recites, \u201CSay something, I'm giving up on you. I'm sorry that I couldn't get to you. Anywhere, I would've followed you. Say something, I'm giving up on you\u201D. This can easily be applied to many situations, such as the loss of a family member, experiencing a breakup with a significant other, or the struggle of having a suicidal friend. \u201CJamais Vu\u201D by BTS (Bangtan Boys) expresses the pain that comes with regret. This song digs deeper into the emotions of the listener and manages to put an indescribable burden into words for millions to relate to. Generation Z has the highest suicide rates in history, and these rates are only going up. The main cause for this is none other than social media platforms. There is a deep pain that comes with seeing others and feeling worthless in comparison, feeling alone. Being able to relate to music gives a feeling of comfort, knowing more people are struggling with the same thing.");
