        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, "Generation Z is known to have exceedingly diverse and artistic music consumption habits. The uniqueness of each individual\u2019s playlist is like a person\u2019s fingerprint. In a recent study done by Brittany Hodak, she discovered that nearly 97% of Generation Z listens to at least five different musical genres regularly (Hodak). Grammy Award-winning trumpeter Wynton Marsalis once expressed, \u201CFor years of teaching in the country, and reading criticism in books, I feel like the things most needed in our culture are the understanding of the meanings of our music. We haven\u2019t done that good of a job teaching our kids what our music means or how we developed our taste in music that reminds us and teaches us who we are\u201D. Generation Z does not just listen to music as a hobby, it is a means of expressing individual personality and teaches people more about themselves. Teenage singer Billie Eilish was recently thrust into fame after her first original song \u201COcean Eyes\u201D became a worldwide sensation at the age of fourteen. She only intended for one person to hear it, her dance teacher, but that was surely not the case. A young girl, writing lyrics purely to express herself, had her life changed after half the globe heard her song. The music of Generation Z consists of a diverse range of styles to listen to.");
