        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](35, "Individuals who are not willing to explore Generation Z\u2019s music would argue that they already have an established music taste. Opponents on the subject wonder why exploring new music is beneficial when already satisfied with a specific style or era. It is understandable that people have solidified music preferences and would like to stick to the same styles they have always liked, but the people who make these points have not experienced the joy and excitement of discovering new music. Generation Z\u2019s music is worth a listen from those of other generations. It is possible to find that a fresh style of music is incredible, but without trying it and being willing to accept change, it is impossible to open the door to a world of undiscovered artistic beauty. A change in culture, or a circumstance that left an impression on the person, are both likely factors to a change in music taste. Without experiencing the brilliance of Generation Z\u2019s music, an accurate opinion cannot be concluded. Therefore, it is valid that Generation Z\u2019s music is worth a listen.");
