        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](35, "Experience is often the first step to creating any music and it is the first reason why our generation stands out. This is the reason many of us have the favorite song that we do; whether the experience is a memory that you associate with the song or the connection of artist and their music, we all connect with music. Ever have a song reach out to you, hit you in your emotions and makes you live in the moment? This is the connection we all share with music. Musicians use what they have lived through to get across ideas, stories, and lessons. They use these experiences that we have all lived through to connect us all through song, whether it\u2019s a Christian song that shares of someone who was saved by God, an Indie Pop song about heartbreak, or a Country song about living life to the fullest. This generation uses most songs to have a purpose; they are either to have you make a moment or relive one in a whole new way. Our music is to give you an experience with every word. This experience can be jamming out to a song in the middle of a party being utterly happy, having a song to just cry over when you need it, or having a song that talks about the same problems you are facing. Using this, today\u2019s artists can reach out to their audience and make them feel. It brings life to their music. The only thing the artist needs is the courage to take the risk of writing their song.");
